import React from "react";
import ReactBodymovin from "react-bodymovin";
import logo from "./icons/blood.json";
import logo2 from "./icons/logo.json";
import "./css/HomeBlocks.css";
import { library } from "@fortawesome/fontawesome-svg-core";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faStroopwafel, faMobileAlt, faMobile, faNewspaperAlt } from "@fortawesome/free-solid-svg-icons";

library.add(faStroopwafel);
library.add(faMobile);
library.add(faMobileAlt);
library.add(faNewspaperAlt);

const Icons = () => {
  const iconOne = {
    loop: false,
    autoplay: true,
    prerender: true,
    animationData: logo
  };
  const iconTwo = {
    loop: true,
    autoplay: true,
    prerender: true,
    animationData: logo2
  };

  return (
    <div className="HomeBlocks">
      <div className="IconAndText">
        <div className="BlockIcon">
          <div className="FaIcon">
            <FontAwesomeIcon icon="faNewspaperAlt" />
          </div>
        </div>
        <p>News</p>
      </div>

      <div className="IconAndText">
        <div className="BlockIcon">
          <div className="FaIcon">
            <FontAwesomeIcon icon="stroopwafel" />
          </div>
        </div>
        <p>Members </p>
      </div>

      <div className="IconAndText">
        <div className="BlockIcon">
          <ReactBodymovin options={iconOne} />
        </div>
        <p>Contacts</p>
      </div>

      <div className="IconAndText">
        <div className="BlockIcon">
          <ReactBodymovin options={iconOne} />
        </div>
        <p>BloodBanks</p>
      </div>

      <div className="IconAndText">
        <div className="BlockIcon">
          <ReactBodymovin options={iconTwo} />
        </div>
        <p>Mobile Apps</p>
      </div>

      <div className="IconAndText">
        <div className="BlockIcon">
          <ReactBodymovin options={iconOne} />
        </div>
        <p>Web Apps </p>
      </div>
    </div>
  );
};

export default Icons;
